import React from 'react';
import jetiLogo from '..src/Components/Img/jetLogo.jpg';
import guiLogo from '..src/Components/Img/guiLogo.jpg';
import tsLogo from '..src/Components/Img/tsLogo.jpg';
import lordeLogo from '..src/Components/Img/lordeLogo.jpg';
import ufsmLogo from '..src/Components/Img/ufsmLogo.jpg';
import './style.css';

export function Stories() {

    return (
        <div className="stories-box">
            <ul className="stories-circles">
                <li className="user1">
                <img src={jetiLogo} alt="Logo" />
                    <p>Seu story</p>
                </li>
                
                <li className="user2">
                <img src={guiLogo} alt="Logo2" />
                    <p>glhrmrg</p>
                </li>

                <li className="user3">
                <img src={tsLogo} alt="Logo2" />
                    <p>taylorswift</p>
                </li>

                <li className="user5">
                <img src={ufsmLogo} alt="Logo2" />
                    <p>ufsm.br</p>
                </li>

                <li className="user4">
                <img src={lordeLogo} alt="Logo2" />
                    <p>lorde</p>
                </li>
            </ul>
        </div>

    )

};
